import React from 'react';
import Jumbotron from 'react-bootstrap/Jumbotron'
import Nav from 'react-bootstrap/Nav'
import video from './videos/dna3.mp4'
import './App.css';

const Video = () => {
  return (
    <div className="container">
      <video autoPlay playsInline muted src={video} loop="true" />
    </div>
  );
};
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Jumbotron>
          <h1>Bioinformatics:
            <p3> Learning Tools <Video /></p3>
          </h1>
          </Jumbotron>
          <Nav
            activeKey="/Description"
            onSelect={(selectedKey) => alert(`selected ${selectedKey}`)}
          >
            <Nav.Item>
              < Nav.Link href="/Description">Description</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link eventKey="GC content">GC content</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link eventKey="GC content plots">GC content plots</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link eventKey="Teanscription">Transcription</Nav.Link>
            </Nav.Item>
          </Nav>
      </header>
    </div>

  );
}

export default App;
